    id: string;
    uid: string;
    firstName: string;
    isAdmin: boolean;
    height: number;
    bodyType: number;
    maritalStatus: string;
    lastName: string;
    email: string;
    username: string;
    about: string;
    subscriptionStart: string;
    subscriptionEnd: string;
    preference: string[];
